PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT ?superclass WHERE {
  rhea:SmallMolecule rdfs:subClassOf ?superclass .
  ?superclass rdfs:label "Compound" .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?subclass ?label WHERE {
  <http://rdf.rhea-db.org/GenericPolynucleotide> rdfs:subClassOf* ?subclass .
  ?subclass rdfs:label ?label .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rdf: <http://rdf.rhea-db.org/>

SELECT ?superclass ?label WHERE {
    rdf:GenericPolypeptide rdfs:subClassOf ?superclass .
    ?superclass rdfs:label ?label .
}
